import Proptypes from "prop-types";
import Link from "next/link";
import { Menu } from "antd";

const AppLayout = ({ children }) => {
  return (
    <Menu mode="horizontal">
      <Menu.Item key="home">
        <Link href={"/"}>
          <a>홈페이지</a>
        </Link>
      </Menu.Item>
      <Menu.Item>
        <Link href={"/notice"}>
          <a>공지사항</a>
        </Link>
      </Menu.Item>
      <Link href={"/reservation"}>
        <a>예약 페이지</a>
      </Link>
      <Menu.Item></Menu.Item>
      <div>
        <div>
          <Link href={"/notice"}>
            <a>공지사항</a>
          </Link>
          <Link href={"/reservation"}>
            <a>예약 페이지</a>
          </Link>
        </div>
        {children}
      </div>
    </Menu>
  );
};

AppLayout.propTypes = {
  children: Proptypes.node.isRequired,
};

export default AppLayout;
